var app = angular.module("popoverApp", ["ngPopover", "multiselectDropdown"]); app.controller("masterController", ["$scope", "ngPopoverFactory",
    function (e, o) {
        e.message = "Click on any of the above buttons to see the popovers in action",
        e.multiselectFeatures = [{ value: "Rajavel" },
            { value: "JohnAlbert" },
            { value: "Niranjana" }, { value: "Jayakumar" }],
        e.multiselectSelection = function (o) { e.message = "You just made a selection in dropdown " + o },
        e.multiselectDdClose = function (o) { e.message = "You just closed dropdown " + o },
        e.miltiselectDdOpen = function (o) { e.message = "You just opened dropdown " + o },
        e.model = {},
        e.model.material = ["option3"],
        e.multiselectModel = ["option3"],
        e.normalMultiselectModel = []
    }]);